%[text] ## Problem 2 (10 points) Ranking US Airports using PageRank
%[text] The PageRank algorithm can be used for ranking not only web pages, but any "entities'' organized into a network. The $\\texttt{USAirTransportation.mat}$ file contains the adjacency matrix $A$ for the network of (anonymized) US airports: nodes represent airports and links represent air travel connections among them. That is, airports $i$ and $j$ are connected $\\left(A\_{ij}=1\\right)$ if there are direct flights between them. The network in $\\texttt{USAirTransportation.mat}$ is obtained by considering the 500 US airports with the largest amount of traffic from [publicly available data](https://toreopsahl.com/datasets/#usairports). Implement the PageRank algorithm (see Lecture 12) for ranking the airports. Use your function from Problem 1 for finding the importance score vector. What are the ID numbers of 10 most important airports for $\\alpha = 0\.10, 0\.15, 0\.20$? 
%[text] Functions that may be useful for this problem:
%[text]{"align":"center"} $\\texttt{repmat(), sort(), disp(), strcat(), num2str()}$
load USAirTransportation.mat % dataset
%{
Let us see how matrix A looks like
%}
figure; %[output:870d7044]
spy(A); %[output:870d7044]
title('Sparsity Patern'); %[output:870d7044]
alpha = [0.10 0.15 0.20]; % values of alpha
[~,n]=size(A); % size of A
%{
Implement the algorithm below
You can use bar() to visualize the scores
Report the top 10 airports (in descending order) for each alpha
%}

% Recall Page Rank only works on stochastic matrices. This will be A_prime
A_prime = zeros(n, n);
for i = 1:n
    column_i = A(:, i);
    A_prime(:, i)= column_i/sum(column_i);
end

S = zeros(n, n);
S(:) = 1/n;
alpha_n = alpha';

for j = 1:size(alpha_n) %[output:group:1e9dfbbc]
    Apb = (1 - alpha_n(j))*A_prime*alpha_n(j)*S;
    [lambda, v] = power_method(Apb);
    v_top = sort(v, 'descend');
    maxVals = v_top(1:10, 1);
    indices = zeros(0,1);
    for k = 1:10
        idx_int = find(v == maxVals(k, 1));
        indices = [indices; idx_int];
    end
    fprintf('Top 10 matrices in descending order for alpha = %.2f,\n', alpha_n(j)); %[output:966bb64e] %[output:32c50e4a] %[output:7b6ab852]
    for p = 1:size(indices)
        disp(indices(p)); %[output:99ccd9f8] %[output:10b44743] %[output:82409fc6]
    end
    fprintf('\n');
end %[output:group:1e9dfbbc]
%[text] ## Problem 5 (10 points) Principal Component Analysis
%[text] In this problem, you will find the principal components of the dataset $\\texttt{pca\\\_data.mat}$, which contains the $m\\times n$ matrix $X$. Columns of $X$ correspond to $n=10^4$ measurements and rows of $X$ correspond to $m=2$ quantities (features). Let us see what the data looks like:
load pca_data.mat
figure; %[output:3dc09ce7]
plot(X(1,:),X(2,:),'.m','MarkerSize',10); %[output:3dc09ce7]
title("PCA raw data"); %[output:3dc09ce7]
axis equal %[output:3dc09ce7]
%[text] ### Part (a)
%[text] Find the $m\\times m$ covariance matrix of $X$. Use $\\texttt{disp()}$ to display it.
[m, n] = size(X);
X0 = zeros(m, n);
ct = mean(X, 2);
X0(1, :) = X(1, :) - ct(1);
X0(2, :) = X(2, :) - ct(2);
covariance = (1/n) * (X0) * (X0');
disp('Covariance matrix of X: '); %[output:66029551]
disp(covariance); %[output:93c4e5fa]
%[text] ### Part (b)
%[text] Find the $m$ principal components of $X$ and show them on top of the original data. That is, if $v$ is a principal component, then plot the line $l(t) = \\mu\+vt$ over the scatter plot shown above, where $\\mu\\in\\mathbb{R}^2$ is the centroid of the data.
%{
Find the eigenvectors
Normalize
Obtain the centroids
Create the lines
Plot
%}
[v, useless] = eig(covariance); %not using power_method in case it's off. 
syms t
figure; %[output:6078c078]
x = ct(1) + t * v(1, 1);
y = ct(2) + t * v(2, 1);
fplot(x, y, '-g'); %[output:6078c078]
hold on %[output:6078c078]
x = ct(1) + t * v(1, 2);
y = ct(2) + t * v(2, 2);
plot(X(1,:),X(2,:),'.m','MarkerSize',10); %[output:6078c078]
title("PCA with principal component line"); %[output:6078c078]
axis equal %[output:6078c078]
fplot(x, y, '-g'); %[output:6078c078]
hold off %[output:6078c078]
%[text] ### Part (c)
%[text] If we change the basis of $\\mathbb{R}^m$ from the standard basis to the basis of the principal components $[v\_1,\\cdots,v\_m] = V$ of $X$, the data matrix will transform to $Y = V^{\-1}X$. Find the covariance of the transformed data $Y$. Use $\\texttt{disp()}$ to display it.
%fetching Y
Y = inv(v) * X;
Y0 = zeros(m ,n);
ct2 = mean(Y, 2);
Y0(1,:) = Y(1, :) - ct2(1);
Y0(2, :) = Y(2, :) - ct2(2);
Covy = (1/n) * (Y0) * (Y0');
disp('Covariance matrix of Y:'); %[output:918a4233]
disp(Covy) %[output:1e04a9ff]
%[text] ### Part (d)
%[text] Principal component analysis is a very popular data analysis technique and it is often used in various applications. As such, it is implemented in most numerical software packages. In MATLAB, this is a built\-in function $\\texttt{pca()}$. In the simplest form, $\\texttt{V = pca(X)}$ returns the principal components of the data matrix $X$, where rows of $X$ correspond to the *measurements* and columns correspond to the *features*. Find the principal components of $X$ using $\\texttt{pca()}$ and compare them with the ones found in part (b). Are they the same?
builtinPCA = pca(X');
disp('Built-in MATLAB PCA Results: '); %[output:7d4524fb]
disp(builtinPCA); %[output:46e7526c]
disp('PCA results from part (B): '); %[output:38470c6e]
disp(v) %[output:6259dc4a]
syms t
figure; %[output:50fc1278]
x = ct(1) + t * v(1, 1);
y = ct(2) + t * v(2, 1);
fplot(x, y, '-g'); %[output:50fc1278]
hold on %[output:50fc1278]
x = ct(1) + t * v(1, 2);
y = ct(2) + t * v(2, 2);
plot(X(1,:),X(2,:),'.m','MarkerSize',10); %[output:50fc1278]
title("PCA with principal component line"); %[output:50fc1278]
axis equal %[output:50fc1278]
fplot(x, y, '-g'); %[output:50fc1278]
x = ct(1) + t * builtinPCA(1, 1);
y = ct(2) + t * builtinPCA(2, 1);
fplot(x, y, '-g'); %[output:50fc1278]
x = ct(1) + t * v(1, 2);
y = ct(2) + t * v(2, 2);
fplot(x, y, '-g'); %[output:50fc1278]
hold off %[output:50fc1278]
%as we can see, there are only 2 lines still, which means our results
%perfectly align with the built in PCA! :)
%[text] ## Problem 6 (10 points) Spectral Method for Graph Partitioning
%[text] A complete graph $K\_n$ with $n$ vertices is a graph in which each pair of graph vertices is connected by an edge. Let $G$ be a barbell\-like graph obtained by connecting $K\_{n\_1}$ and $K\_{n\_2}$ with $m=3$ bridges, where $n\_1=20$ and $n\_2=30$. The graph $G$ and the sparsity pattern of its adjacency matrix are shown:
%{
Adjacency matrix
%}
n1=20; 
n2=30;
B1=ones(n1,n1)-diag(ones(1,n1));
B2=ones(n2,n2)-diag(ones(1,n2));
B=[B1, zeros(n1,n2);zeros(n2,n1), B2]; % adjacency matrix B of graph G
for i=1:3
    B(i,n1+i)=1; B(n1+i,i)=1; % bridges
end
%{
Visualization
%}
figure; %[output:07df7fa8]
spy(B); %[output:07df7fa8]
title("Sparsity pattern of graph G"); %[output:07df7fa8]
figure; %[output:5e722967]
G = graph(B);
plot(G,'NodeLabel',{},'NodeColor','b'); %[output:5e722967]
title("Visualization of the 'barbell-like' graph G"); %[output:5e722967]
%[text] Use the spectral partitioning method to find a division of the graph $G$ into two subgraphs of size $n\_1=20$ and $n\_2=30$ such that the number of edges between the subgraphs (the cut size) is minimized. Visualize the obtained partition and find the corresponding cut size. Useful functions for this problem:
%[text]{"align":"center"} $\\texttt{eigs(), find(), highlight(), plot()}$
%{
-> Find the graph Laplacian
-> Find the Fiedler vector
-> Determine the 2 candidate partitions
-> Visualize
-> Report the cut size using disp()
%}

% LAPLACIAN & FIEDLER VECTOR
n = 50;
Dv = degree(G);
D = zeros(n);
for i = 1:n
    D(i, i) = Dv(i);
end
L = D - B;
[v, ld] = eigs(L, 2, 'SA');
fiedler = v(:, 2);
% PARTITIONS
b1 = (n1 - n2)/sqrt(n);
b2 = 2*(sqrt(n1*n2/n));
p1 = b1 * ones(n, 1) + b2 * fiedler;
p2 = b1 * ones(n, 1) - b2 * fiedler;

p1s = sort(p1, 'descend');
p2s = sort(p2, 'ascend');
maxvals = p1s(1:n1, 1);
minvals = p2s(1:n1, 1);
maxindices = zeros(0, 1);
minindices = zeros(0, 1);

for j = 1:n1
    if length(maxindices) < n1
        maxsofar = find(p1 == maxvals(j, 1));
        if ~ismember(maxsofar, maxindices)
            maxindices = [maxindices; maxsofar];
        end
    else 
        maxindices = maxindices(1:n1, 1);
    end
    if length(minindices) < n1
        minxsofar = find(p2 == minvals(j, 1));
        if ~ismember(minxsofar, minindices)
            minindices = [minindices; minxsofar];
        end
    else 
        minindices = minindices(1:n1, 1);
    end
end

for i = 1:n
    if ismember(i, maxindices)
        p1(i) = 1;
    else
        p1(i) = -1;
    end
    if ismember(i, minindices)
        p2(i) = 1;
    else
        p2(i) = -1;
    end
end

cutsizep1 = 1/4 * p1' * L * p1;
cutsizep2 = 1/4 * p2' * L * p2;
syms cutsizevar;
if cutsizep1 < cutsizep2
    cutsizevar = p1;
else
    cutsizevar = p2;
end

% VISUALIZATION
gf = plot(G, 'NodeColor', 'g'); %[output:4bf7bddc]
locations = find(cutsizevar == 1);
highlight(gf, locations, 'NodeColor', 'r'); %[output:4bf7bddc]

% REPORTING CUT SIZE
disp(cutsizep1); %[output:0bcea8db]
disp(cutsizep2); %[output:4b7cd5c8]
