%[text] ## Problem 1 (10 points) The Power Method (aka Von Mises Iteration)
%[text] Let $A$ be an $n\\times n$ matrix with eigenvalues $\\lambda\_1,\\cdots,\\lambda\_n$ such that:
%[text]{"align":"center"} $|\\lambda\_1|>|\\lambda\_2|>\\cdots>|\\lambda\_n|$
%[text] The eigenvalue $\\lambda\_1$ is called the dominant eigenvalue and the corresponding eigenvector $v\_1$ is called the dominant eigenvector. Write a function that takes $A$ as an argument and uses the Power method (Lecture 12) to compute $\\lambda\_1$ and $v\_1$. We can check that $\\lambda\_1$ is correct by comparing it with the $\\texttt{eig()}$ function for a random matrix. An example is provided below:

E = [9,8,7;6,5,4;3,2,1];
[b, d] = eig(E);
[J, VE] = power_method(E);
disp(d(1)); %[output:1082db81]
disp(J); %[output:8dc86277]

%%
function [lambda, v] = power_method(A)
[n, ~] = size(A); % size of nxn matrix A
v_prev = rand(n, 1); % random starting vector
tol = Inf; % relative error
%{
Implement the algorithm in the while loop
%}
while tol > 1e-15
    intermediate = A * v_prev;
    intermediate = intermediate / norm(intermediate, inf);
    if (norm(intermediate-v_prev, Inf) < tol)
        v_prev = intermediate;
        break;
    end
    v_prev = intermediate;
end
template = A*v_prev;
lambda = template(1)/v_prev(1);
v = v_prev/norm(v_prev);
end

